struct Qubit {
  int id;
  double aRe;
  double aIm;
  double bRe;
  double bIm;
};

double probabilities[16] = {0};
double probabilities2[16] = {0};

void initializeQubit(struct Qubit* q, int i) {
  if (i == 0) {
    q->aRe = 1;
    q->aIm = 0;
    q->bRe = 0;
    q->bIm = 0;
  } else {
    q->aRe = 0;
    q->aIm = 0;
    q->bRe = 1;
    q->bIm = 0;
  }
}

void normalize(struct Qubit* q) {
  // Calculate the magnitude of the state vector
  double magnitude = sqrt((q->aRe * q->aRe + q->aIm * q->aIm) +
                          (q->bRe * q->bRe + q->bIm * q->bIm));

  // Normalize the real and imaginary parts of alpha and beta
  q->aRe /= magnitude;
  q->aIm /= magnitude;
  q->bRe /= magnitude;
  q->bIm /= magnitude;
}

void printQubit(struct Qubit* q) {
  printf("%f\n%f\n%f\n%f\n", q->aRe, q->aIm, q->bRe, q->bIm);
}

double complexAbsolute(double a, double b) { return (a * a + b * b); }

void measureQubit(struct Qubit* q) {
  int count0 = 0;
  int count1 = 0;
  double P0 = complexAbsolute(q->aRe, q->aIm);
  double P1 = complexAbsolute(q->bRe, q->bIm);
  int numMeasurements = 1000;
  for (int i = 0; i < numMeasurements; i++) {
    double randNum = (rand() % 10000) * 1.0 / 10000;
    // printf("%f\n", P1);
    if (randNum < P0) {
      count0++;
    } else {
      count1++;
    }
  }
  if (count0 > count1) {
    q->aRe = 1;
    q->aIm = 0;
    q->bRe = 0;
    q->bIm = 0;
  } else {
    q->aRe = 0;
    q->aIm = 0;
    q->bRe = 1;
    q->bIm = 0;
  }
  printf("Count 0 = %d, Count 1 = %d\n", count0, count1);
}

void hadamardGate(struct Qubit* q) {
  double newAlphaRe, newAlphaIm, newBetaRe, newBetaIm;
  double scale = 1 / sqrt(2);
  newAlphaRe = scale * (q->aRe + q->bRe);
  newAlphaIm = scale * (q->aIm + q->bIm);
  newBetaRe = scale * (q->aRe - q->bRe);
  newBetaIm = scale * (q->aIm - q->bIm);
  q->aRe = newAlphaRe;
  q->aIm = newAlphaIm;
  q->bRe = newBetaRe;
  q->bIm = newBetaIm;
  int qID = q->id;
  probabilities[4 * (qID - 1)] = q->aRe * q->aRe + q->aIm * q->aIm;
  probabilities[4 * (qID - 1) + 1] = q->bRe * q->bRe + q->bIm * q->bIm;
}

void XnotGate(struct Qubit* q) {
  double newAlphaRe, newAlphaIm, newBetaRe, newBetaIm;
  double scale = 1;
  newAlphaRe = scale * q->bRe;
  newAlphaIm = scale * q->bIm;
  newBetaRe = scale * q->aRe;
  newBetaIm = scale * q->aIm;
  q->aRe = newAlphaRe;
  q->aIm = newAlphaIm;
  q->bRe = newBetaRe;
  q->bIm = newBetaIm;
}

void CNOT(struct Qubit* target, struct Qubit* control) {
  // Calculate the probabilities of the control qubit being in |0> and |1>
  double P0 = control->aRe * control->aRe + control->aIm * control->aIm;
  double P1 = control->bRe * control->bRe + control->bIm * control->bIm;

  // Update the target qubit's amplitudes based on the control qubit's
  // probabilities
  double newTargetARe = target->aRe * P0 + target->bRe * P1;
  double newTargetAIm = target->aIm * P0 + target->bIm * P1;
  double newTargetBRe = target->bRe * P0 + target->aRe * P1;
  double newTargetBIm = target->bIm * P0 + target->aIm * P1;

  // Update the target qubit's state
  target->aRe = newTargetARe;
  target->aIm = newTargetAIm;
  target->bRe = newTargetBRe;
  target->bIm = newTargetBIm;

  // Normalize the target qubit to ensure the state remains valid
  normalize(target);
}

void RkGate(struct Qubit* q, int k) {
  double newAlphaRe, newAlphaIm, newBetaRe, newBetaIm;
  double theta = 2 * M_PI / pow(2, k);  // Calculate the angle 2*pi/2^k
  double cosTheta = cos(theta);
  double sinTheta = sin(theta);

  // Alpha remains unchanged
  newAlphaRe = q->aRe;
  newAlphaIm = q->aIm;

  // Beta is multiplied by e^(i*theta) = cos(theta) + i*sin(theta)
  newBetaRe = q->bRe * cosTheta - q->bIm * sinTheta;
  newBetaIm = q->bRe * sinTheta + q->bIm * cosTheta;

  // Update the qubit state
  q->aRe = newAlphaRe;
  q->aIm = newAlphaIm;
  q->bRe = newBetaRe;
  q->bIm = newBetaIm;
}

void controlledRkGate(struct Qubit* target, struct Qubit* control, int k) {
  // Calculate the probabilities of the control qubit being in |0> and |1>
  double P0 = control->aRe * control->aRe + control->aIm * control->aIm;
  double P1 = control->bRe * control->bRe + control->bIm * control->bIm;

  // Update the target qubit's amplitudes based on the control qubit's
  // probabilities
  double newTargetARe =
      target->aRe * P0 + target->aRe * P1;  // Alpha remains unchanged
  double newTargetAIm =
      target->aIm * P0 + target->aIm * P1;  // Alpha remains unchanged

  // Beta is modified by the RkGate operation if the control is in |1>
  double theta = 2 * M_PI / pow(2, k);  // Calculate the angle 2*pi/2^k
  double cosTheta = cos(theta);
  double sinTheta = sin(theta);

  double modifiedBetaRe = target->bRe * cosTheta - target->bIm * sinTheta;
  double modifiedBetaIm = target->bRe * sinTheta + target->bIm * cosTheta;

  double newTargetBRe = target->bRe * P0 + modifiedBetaRe * P1;
  double newTargetBIm = target->bIm * P0 + modifiedBetaIm * P1;

  // Update the target qubit's state
  target->aRe = newTargetARe;
  target->aIm = newTargetAIm;
  target->bRe = newTargetBRe;
  target->bIm = newTargetBIm;

  // Normalize the target qubit to ensure the state remains valid
  normalize(target);
}

void swapTwoQubits(struct Qubit* q1, struct Qubit* q2) {
  struct Qubit temp = *q1;
  *q1 = *q2;
  *q2 = temp;
}

void QuantumFourierTransform4Qubit(struct Qubit* q1, struct Qubit* q2,
                                   struct Qubit* q3, struct Qubit* q4) {
  // Apply Hadamard gate to q1
  hadamardGate(q1);

  // Apply controlled Rk gates with q1 as control
  controlledRkGate(q1, q2, 2);
  controlledRkGate(q1, q3, 3);
  controlledRkGate(q1, q4, 4);

  // // Apply Hadamard gate to q2
  hadamardGate(q2);

  // // Apply controlled Rk gates with q2 as control
  controlledRkGate(q2, q3, 2);
  controlledRkGate(q2, q4, 3);

  // Apply Hadamard gate to q3
  hadamardGate(q3);

  // Apply controlled Rk gate with q3 as control
  controlledRkGate(q3, q4, 2);

  // Apply Hadamard gate to q4
  hadamardGate(q4);

  // Perform swaps to reverse the order of the qubits
  swapTwoQubits(q1, q4);
  swapTwoQubits(q2, q3);
}

