  void draw_line(int x0, int y0, int x1, int y1, short int color) {
    bool is_steep;
    int temp;
    is_steep = abs(y1 - y0) > abs(x1 - x0);
    if (is_steep) {
      temp = x0;
      x0 = y0;
      y0 = temp;
      temp = x1;
      x1 = y1;
      y1 = temp;
    }
    if (x0 > x1) {
      temp = x0;
      x0 = x1;
      x1 = temp;
      temp = y0;
      y0 = y1;
      y1 = temp;
    }
    int deltax = x1 - x0;
  
    int deltay = abs(y1 - y0);
    int error = -(deltax / 2);
    int y = y0;
    int y_step;
    if (y0 < y1) {
      y_step = 1;
    } else {
      y_step = -1;
    }
    for (int x = x0; x <= x1; x++) {
      if (is_steep)
        plot_pixel(y, x, color);
      else
        plot_pixel(x, y, color);
      error = error + deltay;
      if (error > 0) {
        y = y + y_step;
        error = error - deltax;
      }
    }
  }

  void wait_for_vsync() {
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    int status;
    *pixel_ctrl_ptr = 1;  // start the synchronization process
    // write 1 into the front buffer address
    status = *(pixel_ctrl_ptr + 3);  // read the status register
    while ((status & 0x01) != 0) {   // polling loop waiting for s bit to go to 0
      status = *(pixel_ctrl_ptr +
                 3);  // pooling loop/finction when status bit goes to 0
    }
  }


